import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ userRole }) {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Login</Link>
        </li>
        {userRole === 'admin' && (
          <>
            <li>
              <Link to="/dashboard">Dashboard</Link>
            </li>
            <li>
              <Link to="/employees">Employee List</Link>
            </li>
          </>
        )}
        {userRole && (
          <li>
            <Link to="/profile">Profile</Link>
          </li>
        )}
      </ul>
    </nav>
  );
}

export default Navbar;

